window.bookSummaryJSON = "<p>James McGill is sent to the Core Worlds!&nbsp;&nbsp;</p> <p>In an unprecedented first, Earth sends a message to Mogwa Prime. Unfortunately, the messenger is not met with enthusiasm. Misunderstandings soon threaten all of Humanity. Forced to prove Earth can serve the Empire better than any rival, McGill does his best.&nbsp;&nbsp;&nbsp;</p> <p>Eager to prove our worth to the Galactics, the frontier war between Rigel and Earth is expanded to Storm World. Circled by six moons, the planet is ravaged by wild storms and tides. Battles are fought in raging hurricanes, and death stalks the soldiers on both sides.&nbsp;&nbsp;&nbsp;</p> <p>McGill grimly fights and dies in the mud until the job gets done, but will it be enough to satisfy the angry Mogwa?</p>"; 
